import { Hono } from 'hono';
import { cors } from 'hono/cors';
import { logger } from 'hono/logger';
import auth from './routes/auth';
import api from './routes/api';
import { getSession, trackAnalyticsEvent, getAnalytics, getKVMetrics } from './lib/session';
import { getHtml } from './generated/frontend';
import { createLogger, generateRequestId } from './lib/logger';

// App version - increment on each deployment
const APP_VERSION = '3.4.0'; // Share modal, genre families, artist deep dive, completion messages
const GITHUB_REPO = 'TomsTech/spotify-genre-sorter';

const app = new Hono<{ Bindings: Env }>();

// Global error handler with analytics tracking and BetterStack logging
app.onError(async (err, c) => {
  console.error('Worker error:', err);

  // Send to BetterStack
  const log = createLogger(c.executionCtx, c.env.BETTERSTACK_LOG_TOKEN, {
    path: c.req.path,
    method: c.req.method,
  });
  log.logError('Worker error', err, { path: c.req.path });

  // Track error in analytics
  try {
    await trackAnalyticsEvent(c.env.SESSIONS, 'error', {
      message: err.message || 'Unknown error',
      path: c.req.path,
      timestamp: new Date().toISOString(),
    });
  } catch {
    // Don't fail on analytics error
  }
  return c.json({ error: err.message || 'Internal error' }, 500);
});

// Security headers middleware - fixes Google Safe Browsing warnings
app.use('*', async (c, next) => {
  await next();
  c.header('Content-Security-Policy', [
    "default-src 'self'",
    "script-src 'self' 'unsafe-inline' https://static.cloudflareinsights.com",
    "style-src 'self' 'unsafe-inline'",
    "img-src 'self' data: https://flagcdn.com https://i.scdn.co https://avatars.githubusercontent.com https://img.shields.io https://uptime.betterstack.com",
    "connect-src 'self' https://api.spotify.com https://ko-fi.com https://cloudflareinsights.com",
    "frame-ancestors 'none'",
  ].join('; '));
  c.header('X-Content-Type-Options', 'nosniff');
  c.header('X-Frame-Options', 'DENY');
  c.header('X-XSS-Protection', '1; mode=block');
  c.header('Referrer-Policy', 'strict-origin-when-cross-origin');
  c.header('Permissions-Policy', 'camera=(), microphone=(), geolocation=()');
  c.header('Strict-Transport-Security', 'max-age=31536000; includeSubDomains');
});

// BetterStack request logging middleware (logs errors and slow requests)
app.use('*', async (c, next) => {
  const start = Date.now();
  const requestId = generateRequestId();

  await next();

  const duration = Date.now() - start;
  const status = c.res.status;

  // Only log errors (4xx/5xx) or slow requests (>2s) to reduce noise
  if (status >= 400 || duration > 2000) {
    const log = createLogger(c.executionCtx, c.env.BETTERSTACK_LOG_TOKEN, {
      requestId,
      path: c.req.path,
      method: c.req.method,
    });
    log.logRequest(status, duration);
  }
});

// Serve intro video asset
const INTRO_VIDEO_B64 = '';
app.get('/assets/intro-video.mp4', (c) => {
  try {
    const videoBuffer = Uint8Array.from(atob(INTRO_VIDEO_B64), c => c.charCodeAt(0));
    return new Response(videoBuffer, {
      headers: {
        'Content-Type': 'video/mp4',
        'Cache-Control': 'public, max-age=31536000',
      },
    });
  } catch {
    return c.text('Video not available', 404);
  }
});

// Health check - FIRST route, no middleware dependency
// Enhanced with component status for monitoring
app.get('/health', async (c) => {
  const detailed = c.req.query('detailed') === 'true';

  // Basic health check (fast)
  if (!detailed) {
    return c.json({ status: 'ok', version: APP_VERSION });
  }

  // Detailed health check with component status
  const components: Record<string, { status: string; latency?: number }> = {};

  // Check KV availability
  const kvStart = Date.now();
  try {
    await c.env.SESSIONS.get('health_check_probe');
    components.kv = { status: 'ok', latency: Date.now() - kvStart };
  } catch {
    components.kv = { status: 'error', latency: Date.now() - kvStart };
  }

  // Check secrets configured
  const secretsConfigured = !!(
    c.env.SPOTIFY_CLIENT_ID &&
    c.env.SPOTIFY_CLIENT_SECRET
  );
  components.secrets = { status: secretsConfigured ? 'ok' : 'missing' };

  // Overall status
  const allOk = Object.values(components).every(c => c.status === 'ok');

  return c.json({
    status: allOk ? 'ok' : 'degraded',
    version: APP_VERSION,
    components,
    timestamp: new Date().toISOString(),
  });
});

// KV Health check - PUBLIC endpoint for BetterStack monitoring
// Returns status based on KV usage (reads/writes vs free tier limits)
// Returns 503 when critical to trigger BetterStack alerts
app.get('/kv-health', async (c) => {
  try {
    const analytics = await getAnalytics(c.env.SESSIONS);
    const today = analytics.today;
    const realtimeMetrics = getKVMetrics();

    // Free tier limits (reset daily at midnight UTC)
    const READ_LIMIT = 100000;
    const WRITE_LIMIT = 1000;

    // Estimate KV operations based on today's activity
    const breakdown = {
      sessions: {
        reads: Math.round(today.libraryScans * 2 + today.playlistsCreated * 2),
        writes: today.signIns * 2,
      },
      caches: {
        reads: Math.round(today.pageViews * 0.5),
        writes: Math.round(today.pageViews * 0.02),
      },
      userStats: {
        reads: today.playlistsCreated,
        writes: today.playlistsCreated,
      },
      recentPlaylists: {
        reads: Math.round(today.pageViews * 0.3),
        writes: today.playlistsCreated,
      },
      auth: {
        reads: today.signIns * 3,
        writes: today.signIns * 2,
      },
    };

    const estimatedReads = Object.values(breakdown).reduce((sum, cat) => sum + cat.reads, 0);
    const estimatedWrites = Object.values(breakdown).reduce((sum, cat) => sum + cat.writes, 0);

    const readUsagePercent = Math.round((estimatedReads / READ_LIMIT) * 100);
    const writeUsagePercent = Math.round((estimatedWrites / WRITE_LIMIT) * 100);

    // Determine status
    let status: 'ok' | 'warning' | 'critical' = 'ok';
    let message = 'KV storage operating normally';

    if (writeUsagePercent >= 100 || readUsagePercent >= 100) {
      status = 'critical';
      message = writeUsagePercent >= 100
        ? `KV write limit exceeded (${writeUsagePercent}%)`
        : `KV read limit exceeded (${readUsagePercent}%)`;
    } else if (writeUsagePercent > 90 || readUsagePercent > 90) {
      status = 'critical';
      message = `KV approaching limit - writes: ${writeUsagePercent}%, reads: ${readUsagePercent}%`;
    } else if (writeUsagePercent > 80 || readUsagePercent > 80) {
      status = 'warning';
      message = `KV usage elevated - writes: ${writeUsagePercent}%, reads: ${readUsagePercent}%`;
    }

    // Calculate time until reset (midnight UTC)
    const now = new Date();
    const midnight = new Date(now);
    midnight.setUTCDate(midnight.getUTCDate() + 1);
    midnight.setUTCHours(0, 0, 0, 0);
    const hoursUntilReset = Math.round((midnight.getTime() - now.getTime()) / 3600000);

    const response = {
      status,
      message,
      usage: {
        reads: { estimated: estimatedReads, limit: READ_LIMIT, percent: readUsagePercent },
        writes: { estimated: estimatedWrites, limit: WRITE_LIMIT, percent: writeUsagePercent },
      },
      realtime: {
        reads: realtimeMetrics.reads,
        writes: realtimeMetrics.writes,
        cacheHitRate: realtimeMetrics.cacheHits + realtimeMetrics.cacheMisses > 0
          ? Math.round((realtimeMetrics.cacheHits / (realtimeMetrics.cacheHits + realtimeMetrics.cacheMisses)) * 100)
          : 0,
      },
      limitsResetIn: `${hoursUntilReset} hours`,
      timestamp: new Date().toISOString(),
      version: APP_VERSION,
    };

    // Return 503 for critical status so BetterStack detects the issue
    if (status === 'critical') {
      return c.json(response, 503);
    }

    return c.json(response);
  } catch (err) {
    console.error('KV health check failed:', err);
    return c.json({
      status: 'error',
      message: 'Failed to check KV health',
      timestamp: new Date().toISOString(),
      version: APP_VERSION,
    }, 503);
  }
});

// Middleware (after health check so it doesn't block health)
app.use('*', logger());

// CORS - restrict to same-origin only (no cross-origin API access)
// This prevents malicious sites from making requests on behalf of users
app.use('/api/*', cors({
  origin: (origin, c) => {
    // Allow same-origin requests (origin will be null for same-origin)
    // or match the request host
    const host = c.req.header('host');
    if (!origin || origin.includes(host || '')) {
      return origin || '*';
    }
    return null; // Reject cross-origin
  },
  credentials: true,
}));

// Mount routes
app.route('/auth', auth);
app.route('/api', api);

// Setup check - verifies required secrets are configured
app.get('/setup', (c) => {
  const missing: string[] = [];
  const spotifyOnly = c.env.SPOTIFY_ONLY_AUTH === 'true' || !c.env.GITHUB_CLIENT_ID;

  // GitHub secrets only required if not in Spotify-only mode
  if (!spotifyOnly) {
    if (!c.env.GITHUB_CLIENT_ID) missing.push('GITHUB_CLIENT_ID');
    if (!c.env.GITHUB_CLIENT_SECRET) missing.push('GITHUB_CLIENT_SECRET');
  }

  // Spotify secrets always required
  if (!c.env.SPOTIFY_CLIENT_ID) missing.push('SPOTIFY_CLIENT_ID');
  if (!c.env.SPOTIFY_CLIENT_SECRET) missing.push('SPOTIFY_CLIENT_SECRET');
  if (!c.env.SESSIONS) missing.push('SESSIONS (KV namespace)');

  if (missing.length > 0) {
    return c.json({
      configured: false,
      missing,
      authMode: spotifyOnly ? 'spotify-only' : 'github+spotify',
      message: 'Set secrets via: npx wrangler secret put SECRET_NAME'
    }, 503);
  }
  return c.json({
    configured: true,
    authMode: spotifyOnly ? 'spotify-only' : 'github+spotify',
  });
});

// Session status endpoint
app.get('/session', async (c) => {
  // Check if KV is configured
  if (!c.env.SESSIONS) {
    return c.json({ authenticated: false, error: 'KV not configured' });
  }

  const spotifyOnly = c.env.SPOTIFY_ONLY_AUTH === 'true' || !c.env.GITHUB_CLIENT_ID;

  try {
    const session = await getSession(c);
    if (!session) {
      return c.json({ authenticated: false, spotifyOnly });
    }

    // In Spotify-only mode, user is authenticated once Spotify is connected
    const isAuthenticated = spotifyOnly
      ? !!session.spotifyAccessToken
      : !!session.githubUser;

    return c.json({
      authenticated: isAuthenticated,
      spotifyOnly,
      // User info (prefer Spotify in spotify-only mode)
      user: spotifyOnly ? session.spotifyUser : session.githubUser,
      avatar: spotifyOnly ? session.spotifyAvatar : session.githubAvatar,
      // Legacy fields for compatibility
      githubUser: session.githubUser,
      githubAvatar: session.githubAvatar,
      spotifyUser: session.spotifyUser,
      spotifyConnected: !!session.spotifyAccessToken,
    });
  } catch {
    return c.json({ authenticated: false, spotifyOnly, error: 'Session error' });
  }
});

// Stats endpoint - user count and hall of fame (public, no auth)
app.get('/stats', async (c) => {
  try {
    const countStr = await c.env.SESSIONS.get('stats:user_count');
    const count = countStr ? parseInt(countStr, 10) : 0;

    // Get hall of fame (first 10 users for display)
    const hallOfFame: { position: number; spotifyName: string; registeredAt: string }[] = [];
    for (let i = 1; i <= Math.min(count, 10); i++) {
      const hofKey = `hof:${String(i).padStart(3, '0')}`;
      const data = await c.env.SESSIONS.get(hofKey);
      if (data) {
        const entry = JSON.parse(data) as { position: number; spotifyName: string; registeredAt: string };
        hallOfFame.push({
          position: entry.position,
          spotifyName: entry.spotifyName,
          registeredAt: entry.registeredAt,
        });
      }
    }

    return c.json({
      userCount: count,
      launchDate: '2025-11-28',
      hallOfFame,
    });
  } catch {
    return c.json({ userCount: 0, hallOfFame: [] });
  }
});

// Deployment status endpoint - for the deployment monitor widget
app.get('/deploy-status', async (c) => {
  try {
    // Fetch latest workflow run from GitHub Actions
    const response = await fetch(
      `https://api.github.com/repos/${GITHUB_REPO}/actions/workflows/deploy.yml/runs?per_page=1`,
      {
        headers: {
          'Accept': 'application/vnd.github.v3+json',
          'User-Agent': 'Spotify-Genre-Sorter',
        },
      }
    );

    if (!response.ok) {
      // If GitHub API fails, return just the version info
      return c.json({
        version: APP_VERSION,
        deployment: null,
        error: 'Could not fetch deployment status',
      });
    }

    const data: {
      workflow_runs: Array<{
        id: number;
        status: string;
        conclusion: string | null;
        created_at: string;
        updated_at: string;
        head_sha: string;
        actor: {
          login: string;
          avatar_url: string;
        };
      }>;
    } = await response.json();

    const latestRun = data.workflow_runs?.[0];

    if (!latestRun) {
      return c.json({
        version: APP_VERSION,
        deployment: null,
      });
    }

    // If deployment is in progress, try to get current step
    let currentStep = null;
    if (latestRun.status === 'in_progress') {
      try {
        const jobsResponse = await fetch(
          `https://api.github.com/repos/${GITHUB_REPO}/actions/runs/${latestRun.id}/jobs`,
          {
            headers: {
              'Accept': 'application/vnd.github.v3+json',
              'User-Agent': 'Spotify-Genre-Sorter',
            },
          }
        );
        if (jobsResponse.ok) {
          const jobsData: {
            jobs: Array<{
              name: string;
              status: string;
              steps?: Array<{ name: string; status: string }>;
            }>;
          } = await jobsResponse.json();
          const activeJob = jobsData.jobs?.find(j => j.status === 'in_progress');
          const activeStep = activeJob?.steps?.find(s => s.status === 'in_progress');
          currentStep = activeStep?.name || activeJob?.name || 'Deploying...';
        }
      } catch {
        // Ignore errors fetching job details
      }
    }

    return c.json({
      version: APP_VERSION,
      deployment: {
        id: latestRun.id,
        status: latestRun.status,
        conclusion: latestRun.conclusion,
        startedAt: latestRun.created_at,
        updatedAt: latestRun.updated_at,
        commit: latestRun.head_sha.substring(0, 7),
        author: {
          name: latestRun.actor.login,
          avatar: latestRun.actor.avatar_url,
        },
        currentStep,
      },
    });
  } catch {
    return c.json({
      version: APP_VERSION,
      deployment: null,
      error: 'Failed to check deployment status',
    });
  }
});

